import React, { Component } from 'react';

const url='api.openweathermap.org/data/2.5/forecast';
const api='071b80c778e5017e5d6c14ce497cf874';
const city='cali,col';
class Items extends Component{
    consultarclima = async () => {
        const ulrapi=`${url}?q=${city}&appid=${api}`;
        console.log(ulrapi);
        const api_call =  fetch(ulrapi);
        
        console.log(api_call.json());
    }
    
    render(){
        return(
            <h1 onClick={this.consultarclima}>Productos</h1>
           
        )
    }
}
export default Items;
